import React from "react";

import "./Nav.css";
import ImgLogo from "./imgLogo/ImgLogo";
import PagesList from "../pagesList/PagesList";

export default function Nav() {
  return (
    <nav id="navContainer" className="padding-left">
      <ImgLogo />
      <PagesList />
    </nav>
  );
}
